import "./Section1.scss";
import Navbar from "./Navbar";
import gif1 from "../assets/dalga.gif";

export default function Section1() {
  return (
    <div className="Section1">
      <Navbar />
      <div className="write">
        <span>
          Fikirlər yalnız fikir olaraq heç nəyi dəyişməyə qadir deyil. Hacklab fikirlərinizin dünyanı dəyişə biləcəyi və gələcəyin qurulmasında rol ala biləcəyiniz texnoloji reallığa açılan qapı olacaq.
        </span>
      
      </div>
      <div class="gif">
        <img src={gif1} alt="" />
      </div>
    </div>
  );
}
